const PageApi = ({ stars }) =>
  <div>
    Data: {stars}
  </div>

PageApi.getInitialProps = async ({ req }) => {
  const res = await fetch('http://wp:80/wp-json/wp/v2/posts')
  const json = await res.json()
  return { stars: json[0].content.rendered }
}

export default PageApi
